import React, {Component} from 'react';

export function CantCheckOutButton(props) {
	return (
		<input type="button" class={this.props.bookState} value = "대출불가"/>
	);
}

export function CheckOutButton(props) {
	return (
		<input type="button" class={this.props.bookState} value = "대출하기"/>
	);
}

export function CheckInButton(props) {
	return (
		<input type="button" class={this.props.bookState} value = "반납하기"/>
	);
}
